function setCurrentMonitor() {
	currentMonitor = monitorDict[monitorSelected]

	device.createSubdevice(currentMonitor.displayName);
	device.setSubdeviceName(currentMonitor.displayName, currentMonitor.displayName);
	device.setSubdeviceImage(currentMonitor.displayName, currentMonitor.image);
	device.setSubdeviceSize(currentMonitor.displayName, currentMonitor.width, currentMonitor.height);
}

export function Initialize() {
	setCurrentMonitor();
}

export function Shutdown() {
	sendSubDevice(true);
}

export function LedNames() {
	return vKeyNames;
}

export function LedPositions() {
	return vKeyPositions;
}

function sendSubDevice(shutdown = false) {
	var packet = [];

	//initial data
	packet[0] = (currentMonitor == MAG272CQR || currentMonitor == MAG272CR) ? 0x71 : 0x72;
	packet[1]  = 0x01;
	packet[5]  = 0x01;
    packet[6]  = 0x64;
    packet[12] = 0x01;
    packet[16] = 0x01;
    packet[17] = 0x64;

	//ff padding - 0xff 0x00 0x00 ... 0xff 0x00 0x00
	for (let ffPaddingIndex = 23; ffPaddingIndex < currentMonitor.firstRGBDataUSBPacketIndex; ffPaddingIndex += 3)
	{
		packet[ffPaddingIndex] = 0xff;
	}

	//rgb data
	for (let ledIndex = 0; ledIndex < currentMonitor.ledCount; ledIndex++)
	{
		var curLedXCoord = currentMonitor.positioning[ledIndex][0];
		var curLedYCoord = currentMonitor.positioning[ledIndex][1];
		var color;
		if(shutdown) {
		color = hexToRgb(shutdownColor)
		}
		else if (LightingMode == "Forced") {
		color = hexToRgb(forcedColor)
		}
		else {
		color = device.subdeviceColor(currentMonitor.displayName, curLedXCoord, curLedYCoord);
		}

		packet[ledIndex * 3 + currentMonitor.firstRGBDataUSBPacketIndex] = color[0];
		packet[ledIndex * 3 + currentMonitor.firstRGBDataUSBPacketIndex + 1] = color[1];
		packet[ledIndex * 3 + currentMonitor.firstRGBDataUSBPacketIndex + 2] = color[2];
	}

	//more ff padding - 0xff 0x00 0x00 ... 0xff 0x00 0x00
	for (let ffPaddingIndex = currentMonitor.firstRGBDataUSBPacketIndex + currentMonitor.ledCount * 3; ffPaddingIndex < currentMonitor.USBPacketSize - 1; ffPaddingIndex += 3)
	{
		packet[ffPaddingIndex] == 0xff;
	}

	device.send_report(packet, currentMonitor.USBPacketSize);
}

export function Render() {
	sendSubDevice();
}

function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
}

